Many English words end with the silent E. ... Think of all of those four letter words 
that end in an "e. ... Turpentine; Frame; Game; Name; Tame; Same; Came; Dame; 
Fame; Crane; Cake ... Hope; Pope; State; Spite; Trite; Kite; Mite; Late; Extreme; 
Note; Calculate; Reserve ... In words, every syllable needs to have a vowel in it.
